  addDataLocationSettings(containerEl) {
    const plugin = this.plugin;
    const settings = plugin.data.settings;
    new import_obsidian9.Setting(containerEl).setName(t("DATA_LOC")).setDesc(t("DATA_LOC_DESC")).addDropdown((dropdown) => {
      Object.values(DataLocation).forEach((val) => {
        dropdown.addOption(val, val);
      });
      dropdown.setValue(plugin.data.settings.dataLocation);
      dropdown.onChange((val) => {
        const loc = locationMap[val];
        const moveP = new Promise(function(resolve2) {
          if (settings.algorithm !== "Default" /* Default */ && loc === "Save On Note File" /* SaveOnNoteFile */) {
            new ConfirmModal(
              plugin.app,
              "if you want to save data on notefile, you **have to** use Default Algorithm.",
              () => {
                dropdown.setValue(plugin.data.settings.dataLocation);
              }
            ).open();
          } else if (loc === "Save On Note File" /* SaveOnNoteFile */) {
            new ConfirmModal(
              plugin.app,
              "BE CAREFUL!!!  if you confirm this, it will converte                                 all your scheduling informations in `tracked_files.json` will add to note,                                which will change lots of your note file in the same time.",
              async (confirm) => {
                if (confirm) {
                  plugin.data.settings.dataLocation = loc;
                  plugin.store.moveStoreLocation();
                  plugin.data.settings.customFolder = plugin.store.getStorePath();
                  await plugin.store.converteTrackfileToNoteSched();
                  resolve2(true);
                }
              }
            ).open();
          } else if (settings.dataLocation === "Save On Note File" /* SaveOnNoteFile */) {
            new ConfirmModal(
              plugin.app,
              "BE CAREFUL!!! \n if you confirm this, it will converte                                 all your scheduling informations on note(which will be deleted in the same time) TO `tracked_files.json`.",
              async (confirm) => {
                if (confirm) {
                  plugin.data.settings.dataLocation = loc;
                  plugin.store.moveStoreLocation();
                  plugin.data.settings.customFolder = plugin.store.getStorePath();
                  await plugin.store.converteNoteSchedToTrackfile();
                  resolve2(true);
                }
              }
            ).open();
          } else {
            plugin.data.settings.dataLocation = loc;
            plugin.store.moveStoreLocation();
            plugin.data.settings.customFolder = plugin.store.getStorePath();
            resolve2(true);
          }
        });
        moveP.then(() => {
          dropdown.setValue(plugin.data.settings.dataLocation);
          plugin.savePluginData();
          console.debug("finish location change.");
          this.display();
        });
      });
    });
  }
