var import_obsidian15 = require("obsidian");
var reviewNoteResponseModal = class {
  constructor(plugin) {
    this.id = "reviewNoteResponseModalBar";
    this.showInterval = true;
    this.plugin = plugin;
    this.settings = plugin.data.settings;
    const algo = plugin.data.settings.algorithm;
    this.buttonTexts = plugin.data.settings.responseOptionBtnsText[algo];
  }
  algoDisplay(show = true, responseInterval) {
    const plugin = this.plugin;
    const settings = this.settings;
    if (!settings.reviewResponseFloatBar || !settings.autoNextNote)
      return;
    const reviewNoteResponseModalBar = document.getElementById(this.id);
    if (!show) {
      this.selfDestruct();
      return;
    } else if (reviewNoteResponseModalBar) {
      this.plugin.algorithm.srsOptions().forEach((opt, index) => {
        const btn = document.getElementById("sr-" + opt.toLowerCase() + "-btn");
        const text = this.getTextWithInterval(index, responseInterval);
        btn.setText(text);
      });
      return;
    }
    const buttonClick = (s) => {
      const openFile = plugin.app.workspace.getActiveFile();
      if (openFile && openFile.extension === "md") {
        plugin.saveReviewResponsebyAlgo(openFile, s);
      }
    };
    const options = this.plugin.algorithm.srsOptions();
    const optBtnCounts = options.length;
    let btnCols = 4;
    if (!import_obsidian15.Platform.isMobile && optBtnCounts > btnCols) {
      btnCols = optBtnCounts;
    }
    this.containerEl = createEl("div");
    this.containerEl.setAttribute("id", this.id);
    this.containerEl.addClass("ResponseFloatBarDefaultAesthetic");
    this.containerEl.setAttribute("style", `grid-template-columns: ${"1fr ".repeat(btnCols)}`);
    document.body.querySelector(".mod-vertical.mod-root").insertAdjacentElement("afterbegin", this.containerEl);
    this.buttons = [];
    options.forEach((opt, index) => {
      const btn = document.createElement("button");
      btn.setAttribute("id", "sr-" + opt.toLowerCase() + "-btn");
      btn.setAttribute("class", "ResponseFloatBarCommandItem");
      const text = this.getTextWithInterval(index, responseInterval);
      btn.setText(text);
      btn.addEventListener("click", () => buttonClick(opt));
      this.buttons.push(btn);
      this.containerEl.appendChild(btn);
    });
    const showIntvlBtn = document.createElement("button");
    showIntvlBtn.setAttribute("id", "sr-showintvl-btn");
    showIntvlBtn.setAttribute("class", "ResponseFloatBarCommandItem");
    showIntvlBtn.setAttribute(
      "aria-label",
      "\u65F6\u95F4\u95F4\u9694\u663E\u9690,\n\u5EFA\u8BAE\uFF1A\u590D\u4E60\u7C7B\u4E0D\u663E\u793A\uFF0C\u6E10\u8FDB\u603B\u7ED3/\u589E\u91CF\u5199\u4F5C\u663E\u793A"
    );
    (0, import_obsidian15.setIcon)(showIntvlBtn, "alarm-clock");
    showIntvlBtn.addEventListener("click", () => {
      if (this.showInterval) {
        this.showInterval = false;
        (0, import_obsidian15.setIcon)(showIntvlBtn, "alarm-clock-off");
      } else {
        this.showInterval = true;
        (0, import_obsidian15.setIcon)(showIntvlBtn, "alarm-clock");
      }
      this.algoDisplay(show, responseInterval);
    });
    this.buttons.push(showIntvlBtn);
    this.containerEl.appendChild(showIntvlBtn);
    const closeBtn = document.createElement("button");
    closeBtn.setAttribute("id", "sr-close-btn");
    closeBtn.setAttribute("class", "ResponseFloatBarCommandItem");
    closeBtn.setAttribute("aria-label", "\u5173\u95ED\u6D6E\u680F\u663E\u793A");
    closeBtn.setText("X");
    closeBtn.addEventListener("click", () => {
      this.containerEl.style.visibility = "hidden";
      this.selfDestruct();
    });
    this.buttons.push(closeBtn);
    this.containerEl.appendChild(closeBtn);
    this.containerEl.style.visibility = "visible";
  }
  getTextWithInterval(index, responseInterval) {
    let text = this.buttonTexts[index];
    if (this.showInterval) {
      text = responseInterval == null ? `${text}` : import_obsidian15.Platform.isMobile ? textInterval(Number.parseFloat(responseInterval[index].toFixed(5)), true) : `${text} - ${textInterval(
        Number.parseFloat(responseInterval[index].toFixed(5)),
        false
      )}`;
    }
    return text;
  }
  display(show = true, responseInterval) {
    const settings = this.settings;
    if (!settings.reviewResponseFloatBar || !settings.autoNextNote)
      return;
    const menuCommands = [
      {
        id: "obsidian-spaced-repetition:srs-note-review-hard",
        name: "Hard",
        response: 2 /* Hard */,
        text: responseInterval == null ? `${settings.flashcardHardText}` : import_obsidian15.Platform.isMobile ? textInterval(responseInterval[1], true) : `${settings.flashcardHardText} - ${textInterval(
          responseInterval[1],
          false
        )}`,
        icon: "bold-glyph"
      },
      {
        id: "obsidian-spaced-repetition:srs-note-review-good",
        name: "Good",
        response: 1 /* Good */,
        text: responseInterval == null ? `${settings.flashcardGoodText}` : import_obsidian15.Platform.isMobile ? textInterval(responseInterval[2], true) : `${settings.flashcardGoodText} - ${textInterval(
          responseInterval[2],
          false
        )}`,
        icon: "remix-GobletLine"
      },
      {
        id: "obsidian-spaced-repetition:srs-note-review-easy",
        name: "Easy",
        response: 0 /* Easy */,
        text: responseInterval == null ? `${settings.flashcardEasyText}` : import_obsidian15.Platform.isMobile ? textInterval(responseInterval[3], true) : `${settings.flashcardEasyText} - ${textInterval(
          responseInterval[3],
          false
        )}`,
        icon: "remix-EmotionHappyLine"
      }
    ];
    function createMenu(bar) {
      bar.containerEl = createEl("div");
      if (bar.containerEl) {
        bar.containerEl.setAttribute(
          "style",
          `grid-template-columns: ${"1fr ".repeat(menuCommands.length + 1)}`
        );
      }
      bar.containerEl.setAttribute("id", bar.id);
      bar.containerEl.addClass("ResponseFloatBarDefaultAesthetic");
      document.body.querySelector(".mod-vertical.mod-root").insertAdjacentElement("afterbegin", bar.containerEl);
      menuCommands.forEach((item) => {
        const btn = document.createElement("button");
        btn.setAttribute("id", "sr-" + item.name.toLowerCase() + "-btn");
        btn.setAttribute("aria-label", item.name);
        btn.setText(item.text);
        btn.addEventListener("click", () => {
          const openFile = app.workspace.getActiveFile();
          if (openFile && openFile.extension === "md") {
            bar.plugin.saveReviewResponse(openFile, item.response);
          }
        });
        bar.containerEl.appendChild(btn);
      });
      const button = new import_obsidian15.ButtonComponent(bar.containerEl);
      button.setIcon("lucide-x").setClass("ResponseFloatBarCommandItem").setTooltip("\u5173\u95ED\u6D6E\u680F\u663E\u793A").onClick(() => {
        bar.containerEl.style.visibility = "hidden";
        bar.selfDestruct();
      });
      bar.containerEl.style.visibility = "visible";
      console.log("menu:\n", bar.containerEl);
      const timmer = setInterval(() => {
        const reviewNoteResponseModalBar = document.getElementById(
          "reviewNoteResponseModalBar"
        );
        const Markdown = app.workspace.getActiveViewOfType(import_obsidian15.MarkdownView);
        if (reviewNoteResponseModalBar) {
          if (!Markdown || !show) {
            reviewNoteResponseModalBar.style.visibility = "hidden";
            bar.selfDestruct();
            clearInterval(timmer);
          }
        }
      }, 1e4);
    }
    if (show) {
      const reviewNoteResponseModalBar = document.getElementById(this.id);
      if (reviewNoteResponseModalBar) {
        if (responseInterval != null) {
          menuCommands.forEach((item) => {
            const btn = document.getElementById(
              "sr-" + item.name.toLowerCase() + "-btn"
            );
            btn.setText(item.text);
          });
        } else {
          menuCommands.forEach((item) => {
            const btn = document.getElementById(
              "sr-" + item.name.toLowerCase() + "-btn"
            );
            btn.setText(item.name);
          });
        }
        return;
      } else {
        createMenu(this);
      }
    } else {
      this.selfDestruct();
    }
  }
  isDisplay() {
    return document.getElementById(this.id) != null;
  }
  selfDestruct() {
    const reviewNoteResponseModalBar = document.getElementById("reviewNoteResponseModalBar");
    if (reviewNoteResponseModalBar) {
      reviewNoteResponseModalBar.style.visibility = "hidden";
      if (reviewNoteResponseModalBar.firstChild) {
        reviewNoteResponseModalBar.removeChild(reviewNoteResponseModalBar.firstChild);
      }
      reviewNoteResponseModalBar.remove();
    }
  }
};

