    let message = this.version ? Object.values(latestRelease).filter((value) => {
      const ver = value.match(/(?:##\s+\[)([\d\w.]{6,})(?:\s|\])/m)[0];
      return isVersionNewerThanOther(ver, prevRelease);
    }).slice(0, 10).join("\n\n---\n") : FIRST_RUN;
    message = this.version ? FIRST_RUN + message : message;
    await import_obsidian16.MarkdownRenderer.renderMarkdown(message, this.contentEl, "", this.plugin);
